        flexGrow: 1,
        display: 'flex',
        alignItems: 'center',
        color: '#000000',
        fontFamily: 'liebedoni-solid',
        fontSize: 30,
        marginLeft: 5,
    },
    text: {
        flexGrow: 1,
        display: 'flex',
        alignItems: 'center',
        color: '#000000',
        fontSize: 20,
        marginLeft: 5,

    }
    }));

export default useStyles;
